#include <sstream>
#include <string>
#include <unordered_map>
#include <unordered_set>
#include <vector>

using namespace std;

class Solution {
public:
  string removeKdigits(string num, int k) {
    list<char> curr;
    for (char c: num) {
      curr.push_back(c);
    }
    auto p1 = curr.begin();
    while (k > 0) {
      auto p2 = p1;
      p2++;
      while (*p2 >= *p1 && p2 != curr.end()) {
        p1++;
        p2++;
      }
      auto del = p1;
      p1--;
      char c1 = *p1;
      char delc = *del;
      curr.erase(del);
      k--;
    }

    p1 = curr.begin();
    while (*p1 == '0' && p1 != curr.end()) {
      auto p2 = p1;
      p1++;
      curr.erase(p2);
    }

    if (curr.size() == 0) {
      return "0";
    } else {
      string ret;
      for (char c: curr) {
        ret.push_back(c);
      }
      return ret;
    }
  }
};

int main(int argc, const char * argv[]) {
  Solution sol;
  string num;
  int k;

  num = "12345678901234567890"; k = 10;
  cout << sol.removeKdigits(num, k) << endl;

  num = "1111111"; k = 3;
  cout << sol.removeKdigits(num, k) << endl;

  num = "112"; k = 1;
  cout << sol.removeKdigits(num, k) << endl;

  num = "1432219"; k = 3;
  cout << sol.removeKdigits(num, k) << endl;

  num = "10200"; k = 1;
  cout << sol.removeKdigits(num, k) << endl;

  num = "10"; k = 2;
  cout << sol.removeKdigits(num, k) << endl;

  num = "9"; k = 1;
  cout << sol.removeKdigits(num, k) << endl;

  num = "";
    k = 50000;
    cout << sol.removeKdigits(num, k) << endl;

    num = "";
    k = 100000;
    cout << sol.removeKdigits(num, k) << endl;

  return 0;
}
